import React, { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('https://api.lgbusiness.net/api/v1/events/?limit=10&offset=0')
      .then(response => setData(response.data.instances));
  }, []);

  return (
    <table>
      <thead>
        <tr>
          <th>ID</th>
          <th>Created At</th>
          <th>Updated At</th>
          <th>Name</th>
          <th>Date</th>
          <th>Price</th>
          <th>Quantity</th>
          <th>Location</th>
          <th>Latitude</th>
          <th>Longitude</th>
        </tr>
      </thead>
      <tbody>
        {data.map(instance => (
          <tr key={instance._id}>
            <td>{instance._id}</td>
            <td>{instance.createdAt}</td>
            <td>{instance.updatedAt}</td>
            <td>{instance.name}</td>
            <td>{instance.date}</td>
            <td>{instance.price}</td>
            <td>{instance.quantity}</td>
            <td>{instance.location}</td>
            <td>{instance.latitude}</td>
            <td>{instance.longitude}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default App;
